pragma solidity >=0.4.22 <0.9.0;

contract TokenR{

	string public  name = "TokenR";
	uint256 public totalSupply;
	string public symbol = 'TkR';
	string public version = '0.0.0';
	mapping (address=>mapping(address=>uint256)) public allowance;

	event Transfer(
		address indexed _from,
		address indexed _to,
		uint256 _value
	);

	event Approval(
		address indexed _owner,
		address indexed _spender,
		uint256 _value
	);

	mapping(address => uint256) public balanceOf;

	constructor(uint256 _initialSupplyXe18) public{
		balanceOf[msg.sender] = _initialSupplyXe18;
		totalSupply = _initialSupplyXe18;
	}

	//_value in wei format(x 1e18)
	function transfer(address _to, uint256 _valueXe18) public returns(bool success){
		require(balanceOf[msg.sender] >= _valueXe18, "balance is not enough");
		balanceOf[msg.sender] -= _valueXe18;
		balanceOf[_to] += _valueXe18;
		emit Transfer(msg.sender, _to, _valueXe18);
		return true;
	}

	function approve (address _spender, uint256 _valueXe18) public returns(bool success){
		allowance[msg.sender][_spender] = _valueXe18;
		emit Approval(msg.sender, _spender, _valueXe18);
		return true;		
	}

	function transferFrom(address _from, address _to, uint256 _valueXe18) public returns(bool success){

		require(balanceOf[_from]>=_valueXe18, "balance less of source account");
		require(allowance[_from][msg.sender]>=_valueXe18, "transfer value higher than approved");
		allowance[_from][msg.sender] -= _valueXe18;
		balanceOf[_from] -= _valueXe18;
		balanceOf[_to] += _valueXe18;
		emit Transfer(_from, _to, _valueXe18);
		return true;
	}

}
